import React from 'react';
import Reloj from './componets/Reloj';
import Servicios from './componets/Monitores/Servicios';
import Moviles from './componets/Monitores/Moviles';

const App = () => {
  return (
    <React.Fragment>
      <div className="row">
        <div className="col s4">
          <Reloj />          
        </div>
        <div className="col s8">
          <Servicios />  
          <Moviles />        
        </div>       
      </div>
    </React.Fragment>
  );
}

export default App;
